和推入一样，弹出想要改变列表。与推入不同的是，我们实际上想返回一些东西。 但弹出还需要处理一个棘手的角落情况：如果链表是空的怎么办？为了表示这种情况， 我们使用可靠的Option类型： pub fn pop(&mut self) -> Option<i32> { // TODO
} Option<T>是一个枚举，表示一个可能存在的值。它可以是Some(T)，也可以是None。 我们可以像对待Link一样，自己做一个枚举，但是我们希望我们的用户能够理解我们的返回类 型到底是什么，Option 是如此的无处不在，以至于每个人都知道它。事实上，它是如此的 基本，以至于在每个文件中都会隐式地导入到scope中，还有它的变体Some和None（所以 我们不必说Option::None）。 Option<T>上的尖头表示Option实际上是在T上通用的，这意味着你可以为任何类型制 作一个Option! 那么，呃，我们有这个Link的东西，我们怎么知道它是空的还是有More的？模式匹配与 match! pub fn pop(&mut self) -> Option<i32> { match self.head { Link::Empty => { // TODO } Link::More(node) => { // TODO } };
} > cargo build error[E0308]: mismatched types --> src/first.rs:27:30 |
27 | pub fn pop(&mut self) -> Option<i32> { | --- ^^^^^^^^^^^ expected enum `std::option::Option`, found () | | | this function's body doesn't return | = note: expected type `std::option::Option<i32>` found type `()` 糟糕，pop必须返回一个值，而我们还没有这样做。我们 可以 返回None，但在这种情况 下，返回unimplemented!()可能是一个更好的主意，以表明我们还没有完成函数的实现。 unimplemented!()是一个宏(!表示一个宏)，当我们到达它时，它会使程序惊慌失措(~ 以一种可控的方式使它崩溃)。 pub fn pop(&mut self) -> Option<i32> { match self.head { Link::Empty => { // TODO } Link::More(node) => { // TODO } }; unimplemented!()
} 无条件恐慌是 分叉函数 的一个例子。分歧函数永远不会返回给调用者，所以它 们可以用在期待任何类型的值的地方。这里，unimplemented!()被用来代替一个 Option<T>类型的值。 还要注意，我们的程序中不需要写return。一个函数中的最后一个表达式（基本上是行）隐 含了它的返回值。这让我们可以更简洁地表达真正简单的东西。你总是可以像其他类似于C语言 的语言一样，用return提前显式返回。 > cargo build error[E0507]: cannot move out of borrowed content --> src/first.rs:28:15 |
28 | match self.head { | ^^^^^^^^^ | | | cannot move out of borrowed content | help: consider borrowing here: `&self.head`
...
32 | Link::More(node) => { | ---- data moved here |
note: move occurs because `node` has type `std::boxed::Box<first::Node>`, which does not implement the `Copy` trait --> src/first.rs:32:24 |
32 | Link::More(node) => { | ^^^^ 来吧Rust，别烦我们了。一如既往，Rust对我们很生气。值得庆幸的是，这次它也给了我们完 整的信息! 默认情况下，模式匹配会尝试将其内容移动到新的分支中，但我们不能这样做，因 为我们在这里没有拥有self的值。 help: consider borrowing here: `&self.head` Rust说我们应该在匹配中添加一个引用来解决这个问题。🤷♀️让我们试试吧： pub fn pop(&mut self) -> Option<i32> { match &self.head { Link::Empty => { // TODO } Link::More(ref node) => { // TODO } }; unimplemented!()
} > cargo build warning: unused variable: `node` --> src/first.rs:32:24 |
32 | Link::More(node) => { | ^^^^ help: consider prefixing with an underscore: `_node` | = note: #[warn(unused_variables)] on by default warning: field is never used: `elem` --> src/first.rs:13:5 |
13 | elem: i32, | ^^^^^^^^^ | = note: #[warn(dead_code)] on by default warning: field is never used: `next` --> src/first.rs:14:5 |
14 | next: Link, | ^^^^^^^^^^ 万岁，又能编译了! 现在让我们弄清楚这个逻辑。我们想做一个Option，所以让我们为它做一 个变量。在Empty的情况下，我们需要返回None。在More的情况下，我们需要返回Some(i32) ，并改变列表的头。那么，让我们试着基本做到这一点？ pub fn pop(&mut self) -> Option<i32> { let result; match &self.head { Link::Empty => { result = None; } Link::More(ref node) => { result = Some(node.elem); self.head = node.next; } }; result
} > cargo build Compiling lists v0.1.0 (/Users/ABeingessner/dev/temp/lists)
error[E0507]: cannot move out of borrowed content --> src/first.rs:35:29 |
35 | self.head = node.next; | ^^^^^^^^^ cannot move out of borrowed content 脑袋 办公桌 当我们只有一个共享引用的时候，我们正试图搬出节点。 我们也许应该退一步，想想我们要做什么。我们想： 检查列表是否为空。 如果是空的，就返回None 如果它 不是 空的 移除链表的头 移除它的elem 用它的next代替列表的头 返回Some(elem) 关键的见解是我们要 删除 事物，这意味着我们要 通过值 来获得列表的头部。我们当然不能通过我们通过 &self.head得到的共享引用来做到这一点。我们也"只"有一个对self的可变引用，所以我们移动东西 的唯一方法就是 替换它 。看来我们又在跳Empty舞了! 让我们试试吧： pub fn pop(&mut self) -> Option<i32> { let result; match mem::replace(&mut self.head, Link::Empty) { Link::Empty => { result = None; } Link::More(node) => { result = Some(node.elem); self.head = node.next; } }; result
} cargo build Finished dev [unoptimized + debuginfo] target(s) in 0.22s O M G 它在编译时没有 任何 警告!!!!! 其实我在这里要套用一下我个人的套路：我们把这个result做成了返回，但其实我们根本 不需要这么做！就像一个函数运算结果是它的最后一个表达式一样，每个块的运算结果也是 它的最后一个表达式。通常我们会用分号阻止这种行为，这样反而会使块评估为空元组， （）。这实际上是不声明返回值的函数--比如push--返回的值。 因此，我们可以将pop写成： pub fn pop(&mut self) -> Option<i32> { match mem::replace(&mut self.head, Link::Empty) { Link::Empty => None, Link::More(node) => { self.head = node.next; Some(node.elem) } }
} 这更简洁、更惯用。请注意，Link::Empty分支完全失去了括号，因为我们只有一个表达式 需要运算。只是一个很好的简写，用于简单的情况。 cargo build Finished dev [unoptimized + debuginfo] target(s) in 0.22s 好，仍能运行！

