好了，我们已经写好了推入和弹出，现在我们可以真正测试出我们的堆栈了!Rust和cargo 支持测试作为一级功能，所以这将是超级简单的。我们要做的就是写一个函数，然后用 #[test]来注释它。 一般来说，在Rust社区中，我们尽量把测试放在它测试的代码旁边。然而我们通常会为测试做 一个新的命名空间，以避免与"真正的"代码冲突。就像我们使用mod来指定first.rs应该 包含在lib.rs中一样，我们可以使用mod来简单得创建一个全新的 内联 文件。 // in first.rs mod test { #[test] fn basics() { // TODO }
