} impl<'a, T> List<T> { pub fn iter(&'a self) -> Iter<'a, T> { Iter { next: self.head.map(|node| &'a node) } }
} impl<'a, T> Iterator for Iter<'a, T> { type Item = &'a T; fn next(&'a mut self) -> Option<Self::Item> { self.next.map(|node| { self.next = node.next.map(|node| &'a node); &'a node.elem }) }
} > cargo build error: expected `:`, found `node` --> src/second.rs:77:47 |
77 | Iter { next: self.head.map(|node| &'a node) } | ---- while parsing this struct ^^^^ expected `:` error: expected `:`, found `node` --> src/second.rs:85:50 |
85 | self.next = node.next.map(|node| &'a node); | ^^^^ expected `:` error[E0063]: missing field `next` in initializer of `second::Iter<'_, _>` --> src/second.rs:77:9 |
77 | Iter { next: self.head.map(|node| &'a node) } | ^^^^ missing `next` Oh god. We broke Rust. Maybe we should actually figure out what the heck this 'a lifetime stuff even means. Lifetimes can scare off a lot of people because they're a change to something we've known and loved since the dawn of programming. We've actually managed to dodge lifetimes so far, even though they've been tangled throughout our programs this whole time. Lifetimes are unnecessary in garbage collected languages because the garbage collector ensures that everything magically lives as long as it needs to. Most data in Rust is manually managed, so that data needs another solution. C and C++ give us a clear example what happens if you just let people take pointers to random data on the stack: pervasive unmanageable unsafety. This can be roughly separated into two classes of error: Holding a pointer to something that went out of scope Holding a pointer to something that got mutated away Lifetimes solve both of these problems, and 99% of the time, they do this in a totally transparent way. So what's a lifetime? Quite simply, a lifetime is the name of a region (~block/scope) of code somewhere in a program. That's it. When a reference is tagged with a lifetime, we're saying that it has to be valid for that entire region. Different things place requirements on how long a reference must and can be valid for. The entire lifetime system is in turn just a constraint-solving system that tries to minimize the region of every reference. If it successfully finds a set of lifetimes that satisfies all the constraints, your program compiles! Otherwise you get an error back saying that something didn't live long enough. Within a function body you generally can't talk about lifetimes, and wouldn't want to anyway . The compiler has full information and can infer all the contraints to find the minimum lifetimes. However at the type and API-level, the compiler doesn't have all the information. It requires you to tell it about the relationship between different lifetimes so it can figure out what you're doing. In principle, those lifetimes could also be left out, but then checking all the borrows would be a huge whole-program analysis that would produce mind-bogglingly non-local errors. Rust's system means all borrow checking can be done in each function body independently, and all your errors should be fairly local (or your types have incorrect signatures). But we've written references in function signatures before, and it was fine! That's because there are certain cases that are so common that Rust will automatically pick the lifetimes for you. This is lifetime elision . In particular: // Only one reference in input, so the output must be derived from that input
fn foo(&A) -> &B; // sugar for:
fn foo<'a>(&'a A) -> &'a B; // Many inputs, assume they're all independent
fn foo(&A, &B, &C); // sugar for:
fn foo<'a, 'b, 'c>(&'a A, &'b B, &'c C); // Methods, assume all output lifetimes are derived from `self`
fn foo(&self, &B, &C) -> &D; // sugar for:
fn foo<'a, 'b, 'c>(&'a self, &'b B, &'c C) -> &'a D; So what does fn foo<'a>(&'a A) -> &'a B mean ? In practical terms, all it means is that the input must live at least as long as the output. So if you keep the output around for a long time, this will expand the region that the input must be valid for. Once you stop using the output, the compiler will know it's ok for the input to become invalid too. With this system set up, Rust can ensure nothing is used after free, and nothing is mutated while outstanding references exist. It just makes sure the constraints all work out! Alright. So. Iter. Let's roll back to the no lifetimes state: pub struct Iter<T> { next: Option<&Node<T>>,
